-- ----------------------------
-- Table structure for ac_activity
-- ----------------------------
DROP TABLE IF EXISTS `ac_activity`;
CREATE TABLE `ac_activity`  (
  `activity_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动ID',
  `activity_code` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动编号',
  `activity_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动名称',
  `activity_details` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '活动详情',
  `type` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '类型：marketpreferential 市场特惠 marketbuysend 市场买赠',
  `sort` int(2) NOT NULL COMMENT '市场特惠：0 固定价格 1 原价扣减 市场买赠：0 买A赠A',
  `state` int(2) NOT NULL COMMENT '状态：0 待发布 1 已发布 2 已终止 3 已结束',
  `customer_amount` decimal(12, 0) NOT NULL COMMENT '客户数量',
  `produce_amount` decimal(12, 0) NOT NULL COMMENT '产品数量',
  `begin_time` char(19) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动开始时间',
  `end_time` char(19) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动结束时间',
  `is_policy` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '是否参加市场政策：0 不参加 1 参加（第一位代表全额计息、第二位代表发货激励）',
  `create_user_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '创建人ID',
  `publish_user_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '发布人ID',
  `publish_time` char(19) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '活动发布时间',
  `abort_user_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '终止人ID',
  `abort_time` char(19) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '活动终止时间',
  `corp_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '公司ID',
  `ts` char(19) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '最后修改时间',
  `version` int(12) NOT NULL COMMENT '乐观锁',
  PRIMARY KEY (`activity_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '活动基本信息表' ROW_FORMAT = Compact;

